import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import { Route, Routes } from "react-router-dom";
import Mypage from "./page/Mypage";
import Layout from "./component/Layout";  

function App() {
  return (
    <Routes>
      <Route path="/mypage" element={<Layout><Mypage /></Layout>} />
    </Routes>
  );
}

export default App;
